import React from "react";
import Navibar from "../components/Navibar";
import Journey from "../components/Timetable-components/Journey";

export default function Booking() {
   const busJourney = {
    city: "Colombo",
    fare: 1100,
    Name: "Mighty Travels",
    depature: 10,
    arrival: 12,
    seats: 30,
  };


  return (
    <div>
      <h1>Booking Page</h1>
      <br />
      <Navibar />
      <Journey journey={busJourney} color={"primary"} />
    </div>
  );
}
